{"/":{"path":"/","content":"Overview Carta Modern, lightweight, powerful Markdown Editor. Carta is a lightweight, fast and extensible Svelte Markdown editor and viewer, designed for
	flexibility. It works natively in SvelteKit, and supports Server Side Rendering. Features  Markdown syntax highlighting (Shiki);  Toolbar (extensible);  Keyboard shortcuts (extensible);  Supports 150+ plugins thanks to remark;  Scroll sync;  Accessibility friendly;  SSR compatible;  KaTeX support (plugin);  Slash commands (plugin);  Emojis, with included search (plugin);  TikZ support (plugin);  Attachment support (plugin);  Anchor links in headings (plugin);  Code blocks syntax highlighting (plugin);  Embed Components (plugin). Official Plugins Carta comes with a set of official plugins for the most common use cases.   Math Support for KaTex expressions.  Code Code blocks syntax highlighting.  Emoji Embed emojis in Markdown.  Slash Support for slash commands.  TikZ Support for TikZ/PgfPlots diagrams.  Attachment Handle text attachments.  Anchor Add anchor links to headings.  Component Map elements to components.  Community Plugins Explore plugins from the community. Examples A list of examples inspired by popular platforms.   GitHub Inspired by GitHub.  Discord Inspired by Discord.  Math Stack Exchange Inspired by Math Stack Exchange.","html":"<!----><span class="section">Overview</span> <h1 class="title">Carta</h1> <blockquote>Modern, lightweight, powerful Markdown Editor.</blockquote> <p>Carta is a lightweight, fast and extensible Svelte Markdown editor and viewer, designed for
	flexibility. It works natively in SvelteKit, and supports Server Side Rendering.</p> <h2 id="features">Features</h2> <ul><li> Markdown syntax <strong>highlighting</strong> (<a href="https://shiki.style/" target="_blank">Shiki</a>);</li> <li> <strong>Toolbar</strong> (extensible);</li> <li> Keyboard <strong>shortcuts</strong> (extensible);</li> <li> Supports <a href="https://github.com/remarkjs/remark/blob/main/doc/plugins.md#list-of-plugins" target="_blank">150+ plugins</a> thanks to remark;</li> <li> <strong>Scroll</strong> sync;</li> <li> <strong>Accessibility</strong> friendly;</li> <li> <strong>SSR</strong> compatible;</li> <li> KaTeX support (plugin);</li> <li> Slash commands (plugin);</li> <li> Emojis, with included search (plugin);</li> <li> TikZ support (plugin);</li> <li> Attachment support (plugin);</li> <li> Anchor links in headings (plugin);</li> <li> Code blocks syntax highlighting (plugin);</li> <li> Embed Components (plugin).</li></ul> <h2 id="official-plugins">Official Plugins</h2> <p>Carta comes with a set of official plugins for the most common use cases.</p> <br> <div class="grid w-full gap-4 sm:grid-cols-2"><a href="./plugins/math" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="tabler:math" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->Math<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Support for KaTex expressions.<!----></p><!----><!----></div><!----><!----></a><!----> <a href="./plugins/code" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="fluent:code-16-filled" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->Code<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Code blocks syntax highlighting.<!----></p><!----><!----></div><!----><!----></a><!----> <a href="./plugins/emoji" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="mingcute:emoji-line" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->Emoji<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Embed emojis in Markdown.<!----></p><!----><!----></div><!----><!----></a><!----> <a href="./plugins/slash" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="tabler:slash" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->Slash<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Support for slash commands.<!----></p><!----><!----></div><!----><!----></a><!----> <a href="./plugins/tikz" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="mdi:draw-pen" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->TikZ<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Support for TikZ/PgfPlots diagrams.<!----></p><!----><!----></div><!----><!----></a><!----> <a href="./plugins/attachment" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="tdesign:attach" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->Attachment<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Handle text attachments.<!----></p><!----><!----></div><!----><!----></a><!----> <a href="./plugins/anchor" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="mingcute:link-fill" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->Anchor<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Add anchor links to headings.<!----></p><!----><!----></div><!----><!----></a><!----> <a href="./plugins/component" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="ri:svelte-fill" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->Component<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Map elements to components.<!----></p><!----><!----></div><!----><!----></a><!----> <a href="./community-plugins" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="ph:stack-fill" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->Community Plugins<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Explore plugins from the community.<!----></p><!----><!----></div><!----><!----></a><!----></div> <h2 id="examples">Examples</h2> <p>A list of examples inspired by popular platforms.</p> <br> <div class="grid w-full gap-4 sm:grid-cols-2"><a href="./examples#github" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="mdi:github" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->GitHub<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Inspired by GitHub.<!----></p><!----><!----></div><!----><!----></a><!----> <a href="./examples#discord" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="ic:baseline-discord" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->Discord<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Inspired by Discord.<!----></p><!----><!----></div><!----><!----></a><!----> <a href="./examples#math-stack-exchange" class="bg-card text-card-foreground block rounded-xl border bg-opacity-30 shadow hover:border-sky-300"><div class="flex flex-col space-y-1.5 p-6"><iconify-icon icon="fluent:math-formula-16-filled" class="text-3xl text-sky-300"></iconify-icon> <!----><h3 class="font-semibold leading-none tracking-tight"><!---->Math Stack Exchange<!----><!----></h3><!----><!----> <p class="text-muted-foreground text-base"><!---->Inspired by Math Stack Exchange.<!----></p><!----><!----></div><!----><!----></a><!----></div><!----><!---->","title":"Carta"},"/api/core":{"path":"/api/core","content":"API Core Carta options List of options that can be used when creating Carta: gfmOptions Type: GfmOptions GitHub Flavored Markdown options. extensions Type: Extension[] List of extensions(plugins) to use. rendererDebounce Type: number Rendering debouncing timeout, in milliseconds. Defaults to 300ms. disableShortcuts Type: DefaultShortcutId[] | true Remove default shortcuts by id. You can use true to disable all of them. disableIcons Type: DefaultIconId[] | true Remove default icons by id. You can use true to disable all of them. disablePrefixes Type: DefaultPrefixId[] | true Remove default prefixes by id. You can use true to disable all of them. disableTabOuts Type: DefaultTabOutId[] | true Remove default tab-outs by id. You can use true to disable all of them. historyOptions History management options. historyOptions.minInterval Type: number Minimum interval between save states in milliseconds. Defaults to 300ms. historyOptions.maxSize Type: number Maximum history size in bytes. Defaults to 1MB. sanitizer Type: (html: string) => void HTML sanitizer. See here for more details. shikiOptions Type: ShikiOptions Highlighter(Shiki) options. theme Type: Theme | DualTheme Shiki theme to use to highlight Markdown. MarkdownEditor options List of options that can be used in the <MarkdownEditor> component. carta Type: Carta Carta instance to use for this editor. theme Type: string The theme of this editor. The editor and related elements will have carta-theme_<theme> as a class. value Type: string Current Markdown input value. mode Type: 'tabs' | 'split' | 'auto' Editor windows mode. With auto it will split when the window size is greater than 768px. scroll Type: 'sync' | 'async' Scroll synchronization. disableToolbar Type: boolean Option to disable the toolbar. placeholder Type: string Set the textarea placeholder. textarea Type: TextAreaProps (extends Record<string, unknown>) Additional properties that will be used in the textarea used under the hood in the editor. class, placeholder and value are not allowed. Use the corresponding editor properties
	instead. labels Type: Partial<Labels> Can be used to provide custom text for labels in the editor. highlightDelay Type: number Highlight delay in milliseconds. Defaults to 250ms. Markdown options List of options that can be used in the <Markdown> component. carta Type: Carta Carta instance to use for this editor. theme Type: string The theme to use. The element will have carta-theme_<theme> as a class. value Type: string Current Markdown input value. selectedTab Type: 'write' | 'preview' The selected editor tab. PreRendered options List of options that can be used in the <PreRendered> component. html Type: string The HTML to render. It is NOT sanitized. theme Type: string The theme to use. The element will have carta-theme_<theme> as a class.","html":"<!----><span class="section">API</span> <h1 class="title">Core</h1> <h2 id="carta-options"><code>Carta</code> options</h2> <p>List of options that can be used when creating <code>Carta</code>:</p> <h3 id="gfm-options"><code>gfmOptions</code></h3> <p>Type: <code>GfmOptions</code></p> <p>GitHub Flavored Markdown options.</p> <h3 id="extensions"><code>extensions</code></h3> <p>Type: <code>Extension[]</code></p> <p>List of extensions(plugins) to use.</p> <h3 id="renderer-debounce"><code>rendererDebounce</code></h3> <p>Type: <code>number</code></p> <p>Rendering debouncing timeout, in milliseconds. Defaults to 300ms.</p> <h3 id="disable-shortcuts"><code>disableShortcuts</code></h3> <p>Type: <code>DefaultShortcutId[] | true</code></p> <p>Remove default shortcuts by id. You can use <code>true</code> to disable all of them.</p> <h3 id="disable-icons"><code>disableIcons</code></h3> <p>Type: <code>DefaultIconId[] | true</code></p> <p>Remove default icons by id. You can use <code>true</code> to disable all of them.</p> <h3 id="disable-prefixes"><code>disablePrefixes</code></h3> <p>Type: <code>DefaultPrefixId[] | true</code></p> <p>Remove default prefixes by id. You can use <code>true</code> to disable all of them.</p> <h3 id="disable-tab-outs"><code>disableTabOuts</code></h3> <p>Type: <code>DefaultTabOutId[] | true</code></p> <p>Remove default tab-outs by id. You can use <code>true</code> to disable all of them.</p> <h3 id="history-options"><code>historyOptions</code></h3> <p>History management options.</p> <h4><code>historyOptions.minInterval</code></h4> <p>Type: <code>number</code></p> <p>Minimum interval between save states in milliseconds. Defaults to 300ms.</p> <h4><code>historyOptions.maxSize</code></h4> <p>Type: <code>number</code></p> Maximum history size in bytes. Defaults to 1MB. <h3 id="sanitizer"><code>sanitizer</code></h3> <p>Type: <code>(html: string) =&gt; void</code></p> <p>HTML sanitizer. See here for <a href="../getting-started#sanitization">more</a> details.</p> <h3 id="shiki-options"><code>shikiOptions</code></h3> <p>Type: <code>ShikiOptions</code></p> <p>Highlighter(Shiki) options.</p> <h3 id="theme"><code>theme</code></h3> <p>Type: <code>Theme | DualTheme</code></p> <p>Shiki theme to use to highlight Markdown.</p> <h2 id="markdown-editor-options"><code>MarkdownEditor</code> options</h2> <p>List of options that can be used in the <code>&lt;MarkdownEditor&gt;</code> component.</p> <h3 id="editor-carta"><code>carta</code></h3> <p>Type: <code>Carta</code></p> <p>Carta instance to use for this editor.</p> <h3 id="editor-theme"><code>theme</code></h3> <p>Type: <code>string</code></p> <p>The theme of this editor. The editor and related elements will have <code>carta-theme_&lt;theme&gt;</code> as a class.</p> <h3 id="editor-value"><code>value</code></h3> <p>Type: <code>string</code></p> <p>Current Markdown input value.</p> <h3 id="mode"><code>mode</code></h3> <p>Type: <code>'tabs' | 'split' | 'auto'</code></p> <p>Editor windows mode. With <code>auto</code> it will split when the window size is greater than 768px.</p> <h3 id="scroll"><code>scroll</code></h3> <p>Type: <code>'sync' | 'async'</code></p> <p>Scroll synchronization.</p> <h3 id="disable-toolbar"><code>disableToolbar</code></h3> <p>Type: <code>boolean</code></p> <p>Option to disable the toolbar.</p> <h3 id="placeholder"><code>placeholder</code></h3> <p>Type: <code>string</code></p> <p>Set the textarea placeholder.</p> <h3 id="textarea"><code>textarea</code></h3> <p>Type: <code>TextAreaProps</code> (extends <code>Record&lt;string, unknown&gt;</code>)</p> <p>Additional properties that will be used in the textarea used under the hood in the editor. <code>class</code>, <code>placeholder</code> and <code>value</code> are not allowed. Use the corresponding editor properties
	instead.</p> <h3 id="labels"><code>labels</code></h3> <p>Type: <code>Partial&lt;Labels&gt;</code></p> <p>Can be used to provide custom text for labels in the editor.</p> <h3 id="highlight-delay"><code>highlightDelay</code></h3> <p>Type: <code>number</code></p> <p>Highlight delay in milliseconds. Defaults to 250ms.</p> <h2 id="markdown-options"><code>Markdown</code> options</h2> <p>List of options that can be used in the <code>&lt;Markdown&gt;</code> component.</p> <h3 id="markdown-carta"><code>carta</code></h3> <p>Type: <code>Carta</code></p> <p>Carta instance to use for this editor.</p> <h3 id="markdown-theme"><code>theme</code></h3> <p>Type: <code>string</code></p> <p>The theme to use. The element will have <code>carta-theme_&lt;theme&gt;</code> as a class.</p> <h3 id="markdown-value"><code>value</code></h3> <p>Type: <code>string</code></p> <p>Current Markdown input value.</p> <h3 id="selected-tab"><p>selectedTab</p></h3> <p>Type: <code>'write' | 'preview'</code></p> <p>The selected editor tab.</p> <h3 id="pre-rendered-options"><code>PreRendered</code> options</h3> <p>List of options that can be used in the <code>&lt;PreRendered&gt;</code> component.</p> <h3 id="html"><code>html</code></h3> <p>Type: <code>string</code></p> <p>The HTML to render. It is <code>NOT</code> sanitized.</p> <h3 id="pre-rendered-theme"><code>theme</code></h3> <p>Type: <code>string</code></p> <p>The theme to use. The element will have <code>carta-theme_&lt;theme&gt;</code> as a class.</p><!----><!---->","title":"Core"},"/api/extension":{"path":"/api/extension","content":"API Extension Plugin properties You can easily extend Carta by creating custom plugins. const plugin: Plugin = {
  // ...
};

const carta = new Carta({
  extensions: [plugin]
});  Here are all the Plugin properties: transformers Type: UnifiedTransformer Remark or Rehype transformers. const transformer: UnifiedTransformer = {
  execution: 'sync',
  type: 'rehype',
  transform({ processor }) {
    processor
      .use(rehypeSlug)
      .use(rehypeAutolinkHeadings);
  }
}  UnifiedTransformer.execution Type:'sync' | 'async' If you specify async, this transformer wont be available for SSR. UnifiedTransformer.type Type:'remark' | 'rehype' This determines at which step the transformer will operate, whether on Remark, on a Markdown-based
	syntax tree, or Rehype, on a HTML-based one. UnifiedTransformer.transform Type: ({(processor, carta)}) => void The actual processor, can be async if the execution is specified as such. shortcuts Type:KeyboardShortcut[] Additional keyboards shortcut. For example: const shortcut: KeyboardShortcut = {
  id: 'bold',
  combination: new Set(['control', 'b']),
  action: (input) => input.toggleSelectionSurrounding('**')
};  KeyboardShortcut.id Type: string Id of the shortcut. KeyboardShortcut.combination Type: Set<string> Set of keys, corresponding to the e.key of KeyboardEvents, but
	lowercase. KeyboardShortcut.action Type: (input: InputEnhancer) => void Shortcut callback function. KeyboardShortcut.preventSave Prevent saving the current state in history. icons Type: Icon[] Additional toolbar icons. For example: const icon: Icon = {
  id: 'heading',
  action: (input) => input.toggleLinePrefix('###'),
  component: HeadingIcon
};  Icon.id Type: string Id of the icon. Icon.action Type: (input: InputEnhancer) => void Click callback. Icon.component Type: ComponentType (SvelteComponent) The Icon as a Svelte component. prefixes Type: Prefix[] Text prefixes, default ones include the - for bulleted lists, 1. for
	numbered lists, - [ ] for task lists. const prefix: Prefix = {
  id: 'bulletedList',
  match: (line) => {
    const prefix = line.slice(0, 2);
    if (prefix === '- ') return prefix;
  },
  maker: () => '- '
};  Prefix.id Type: string Id of the prefix. Prefix.match Type: (line: string) => string | undefined Function that returns the prefix, if it is present. Prefix.maker Type: (previousMatch: string, previousLine: string) => string Function that returns the prefix for the new line.  Example: const prefix: Prefix = {
  id: 'numberedList',
  match: (line) => line.match(/^d+./)?.at(0),
  maker: (prev) => `${Number(prev.slice(0, -1)) + 1}. `
};  tabOuts Tab-outs allow users to use the tab key to skip certain pieces of text. For
	example, after using the bold shortcut and having typed the text, you can press tab to skip the ending **. const tabOut: TabOut = {
  id: 'strikethrough',
  delimiter: '~~'
};  TabOut.id Type: string Id of the tab-out. TabOut.delimiter Type: string | readonly string[] Text(s) to check for. If one of them is found after the textarea selectionEnd,
	pressing tab will place the cursor after that. listeners Type: Listener[] Textarea event listeners. Has an additional carta-render and carta-render-ssr events keys. const click: Listener = ['click', () => console.log('I was clicked!')];
const render: Listener = [
  'carta-render',
  (e) => {
    const carta = e.detail.carta;
    // ...
  },
  {
    once: true
  }
];  components Type: ExtensionComponent[] Additional components to be added to the editor or viewer. ExtensionComponent<T>.component Type: typeof SvelteComponentTyped<T & { carta: Carta }> Svelte components that exports carta: Carta and all the other properties specified as
	the generic parameter and in props. ExtensionComponent<T>.props Type: T Properties that will be handed to the component. ExtensionComponent<T>.parent Type: MaybeArray<'editor' | 'input' | 'renderer' | 'preview'> Where the element will be placed. grammarRules Type: GrammarRule[] Custom Markdown TextMate grammar rules for Shiki. They will be injected into the language. highlightRules Type: HighlightingRule[] Custom highlighting rules for ShiKi. They will be injected into the selected theme. onLoad Type: (data: { carta: Carta; highlight: HighlightFunctions }) => void Use this callback to execute code when one Carta instance loads the extension.","html":"<!----><span class="section">API</span> <h1 class="title">Extension</h1> <h2 id="plugin-properties"><code>Plugin</code> properties</h2> <p>You can easily extend Carta by creating custom plugins.</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> plugin</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">Plugin</span><span style="color:#EEF0F9"> = {</span></span>
<span class="line"><span style="color:#EEF0F98F;font-style:italic">  // ...</span></span>
<span class="line"><span style="color:#EEF0F9">};</span></span>
<span class="line"></span>
<span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> carta</span><span style="color:#EEF0F9"> = </span><span style="color:#54B9FF">new</span><span style="color:#00DAEF"> Carta</span><span style="color:#EEF0F9">({</span></span>
<span class="line"><span style="color:#4BF3C8">  extensions</span><span style="color:#EEF0F9">: [</span><span style="color:#4BF3C8">plugin</span><span style="color:#EEF0F9">]</span></span>
<span class="line"><span style="color:#EEF0F9">});</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----> <p>Here are all the <code>Plugin</code> properties:</p> <h3 id="transformers"><code>transformers</code></h3> <p>Type: <code>UnifiedTransformer</code></p> <p>Remark or Rehype transformers.</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> transformer</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">UnifiedTransformer</span><span style="color:#EEF0F9"> = {</span></span>
<span class="line"><span style="color:#4BF3C8">  execution</span><span style="color:#EEF0F9">: </span><span style="color:#FFD493">'sync'</span><span style="color:#EEF0F9">,</span></span>
<span class="line"><span style="color:#4BF3C8">  type</span><span style="color:#EEF0F9">: </span><span style="color:#FFD493">'rehype'</span><span style="color:#EEF0F9">,</span></span>
<span class="line"><span style="color:#00DAEF">  transform</span><span style="color:#EEF0F9">({ </span><span style="color:#4BF3C8;font-style:italic">processor</span><span style="color:#EEF0F9"> }) {</span></span>
<span class="line"><span style="color:#4BF3C8">    processor</span></span>
<span class="line"><span style="color:#EEF0F9">      .</span><span style="color:#00DAEF">use</span><span style="color:#EEF0F9">(</span><span style="color:#4BF3C8">rehypeSlug</span><span style="color:#EEF0F9">)</span></span>
<span class="line"><span style="color:#EEF0F9">      .</span><span style="color:#00DAEF">use</span><span style="color:#EEF0F9">(</span><span style="color:#4BF3C8">rehypeAutolinkHeadings</span><span style="color:#EEF0F9">);</span></span>
<span class="line"><span style="color:#EEF0F9">  }</span></span>
<span class="line"><span style="color:#EEF0F9">}</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----> <h4 id="transformer-execution"><code>UnifiedTransformer.execution</code></h4> Type:<code>'sync' | 'async'</code> <p>If you specify async, this transformer wont be available for SSR.</p> <h4 id="transformer-type"><code>UnifiedTransformer.type</code></h4> Type:<code>'remark' | 'rehype'</code> <p>This determines at which step the transformer will operate, whether on Remark, on a Markdown-based
	syntax tree, or Rehype, on a HTML-based one.</p> <h4 id="transformer-transform"><code>UnifiedTransformer.transform</code></h4> <p>Type: <code>({(processor, carta)}) =&gt; void</code></p> <p>The actual processor, can be async if the execution is specified as such.</p> <h3 id="shortcuts"><code>shortcuts</code></h3> Type:<code>KeyboardShortcut[]</code> <p>Additional keyboards shortcut. For example:</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> shortcut</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">KeyboardShortcut</span><span style="color:#EEF0F9"> = {</span></span>
<span class="line"><span style="color:#4BF3C8">  id</span><span style="color:#EEF0F9">: </span><span style="color:#FFD493">'bold'</span><span style="color:#EEF0F9">,</span></span>
