<span class="line"><span style="color:#EEF0F9">};</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----> <h4 id="shortcut-id"><code>KeyboardShortcut.id</code></h4> <p>Type: <code>string</code></p> <p>Id of the shortcut.</p> <h4 id="shortcut-combination"><code>KeyboardShortcut.combination</code></h4> <p>Type: <code>Set&lt;string&gt;</code></p> <p>Set of keys, corresponding to the <code>e.key</code> of <code>KeyboardEvents</code>, but
	lowercase.</p> <h4 id="shortcut-action"><code>KeyboardShortcut.action</code></h4> <p>Type: <code>(input: InputEnhancer) =&gt; void</code></p> <p>Shortcut callback function.</p> <h4 id="shortcut-prevent-save"><code>KeyboardShortcut.preventSave</code></h4> <p>Prevent saving the current state in history.</p> <h3 id="icons"><code>icons</code></h3> <p>Type: <code>Icon[]</code></p> <p>Additional toolbar icons. For example:</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> icon</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">Icon</span><span style="color:#EEF0F9"> = {</span></span>
