	numbered lists, <code>- [ ]</code> for task lists.</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> prefix</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">Prefix</span><span style="color:#EEF0F9"> = {</span></span>
<span class="line"><span style="color:#4BF3C8">  id</span><span style="color:#EEF0F9">: </span><span style="color:#FFD493">'bulletedList'</span><span style="color:#EEF0F9">,</span></span>
