<span class="line"><span style="color:#54B9FF">    if</span><span style="color:#EEF0F9"> (</span><span style="color:#4BF3C8">prefix</span><span style="color:#EEF0F9"> === </span><span style="color:#FFD493">'- '</span><span style="color:#EEF0F9">) </span><span style="color:#54B9FF">return</span><span style="color:#4BF3C8"> prefix</span><span style="color:#EEF0F9">;</span></span>
<span class="line"><span style="color:#EEF0F9">  },</span></span>
