<span class="line"><span style="color:#EEF0F9">};</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----> <h4 id="prefix-id"><code>Prefix.id</code></h4> <p>Type: <code>string</code></p> <p>Id of the prefix.</p> <h4 id="prefix-match"><code>Prefix.match</code></h4> <p>Type: <code>(line: string) =&gt; string | undefined</code></p> <p>Function that returns the prefix, if it is present.</p> <h4 id="prefix-maker"><code>Prefix.maker</code></h4> <p>Type: <code>(previousMatch: string, previousLine: string) =&gt; string</code></p> <p>Function that returns the prefix for the new line. <br> Example:</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> prefix</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">Prefix</span><span style="color:#EEF0F9"> = {</span></span>
<span class="line"><span style="color:#4BF3C8">  id</span><span style="color:#EEF0F9">: </span><span style="color:#FFD493">'numberedList'</span><span style="color:#EEF0F9">,</span></span>
