<span class="line"><span style="color:#00DAEF">  maker</span><span style="color:#EEF0F9">: (</span><span style="color:#4BF3C8;font-style:italic">prev</span><span style="color:#EEF0F9">) </span><span style="color:#54B9FF">=&gt;</span><span style="color:#FFD493"> `</span><span style="color:#54B9FF">${</span><span style="color:#00DAEF">Number</span><span style="color:#EEF0F9">(</span><span style="color:#4BF3C8">prev</span><span style="color:#EEF0F9">.</span><span style="color:#00DAEF">slice</span><span style="color:#EEF0F9">(</span><span style="color:#FFD493">0</span><span style="color:#EEF0F9">, -</span><span style="color:#FFD493">1</span><span style="color:#EEF0F9">)) + </span><span style="color:#FFD493">1</span><span style="color:#54B9FF">}</span><span style="color:#FFD493">. `</span></span>
