	example, after using the bold shortcut and having typed the text, you can press <code>tab</code> to skip the ending <code>**</code>.</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> tabOut</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">TabOut</span><span style="color:#EEF0F9"> = {</span></span>
