	pressing tab will place the cursor after that.</p> <h3 id="listeners"><code>listeners</code></h3> <p>Type: <code>Listener[]</code></p> <p>Textarea event listeners. Has an additional <code>carta-render</code> and <code>carta-render-ssr</code> events keys.</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> click</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">Listener</span><span style="color:#EEF0F9"> = [</span><span style="color:#FFD493">'click'</span><span style="color:#EEF0F9">, () </span><span style="color:#54B9FF">=&gt;</span><span style="color:#4BF3C8"> console</span><span style="color:#EEF0F9">.</span><span style="color:#00DAEF">log</span><span style="color:#EEF0F9">(</span><span style="color:#FFD493">'I was clicked!'</span><span style="color:#EEF0F9">)];</span></span>
<span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> render</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">Listener</span><span style="color:#EEF0F9"> = [</span></span>
<span class="line"><span style="color:#FFD493">  'carta-render'</span><span style="color:#EEF0F9">,</span></span>
<span class="line"><span style="color:#EEF0F9">  (</span><span style="color:#4BF3C8;font-style:italic">e</span><span style="color:#EEF0F9">) </span><span style="color:#54B9FF">=&gt;</span><span style="color:#EEF0F9"> {</span></span>
<span class="line"><span style="color:#54B9FF">    const</span><span style="color:#ACAFFF"> carta</span><span style="color:#EEF0F9"> = </span><span style="color:#4BF3C8">e</span><span style="color:#EEF0F9">.</span><span style="color:#4BF3C8">detail</span><span style="color:#EEF0F9">.</span><span style="color:#4BF3C8">carta</span><span style="color:#EEF0F9">;</span></span>
<span class="line"><span style="color:#EEF0F98F;font-style:italic">    // ...</span></span>
<span class="line"><span style="color:#EEF0F9">  },</span></span>
<span class="line"><span style="color:#EEF0F9">  {</span></span>
<span class="line"><span style="color:#4BF3C8">    once</span><span style="color:#EEF0F9">: </span><span style="color:#FFD493">true</span></span>
<span class="line"><span style="color:#EEF0F9">  }</span></span>
<span class="line"><span style="color:#EEF0F9">];</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----> <h3 id="components"><code>components</code></h3> <p>Type: <code>ExtensionComponent[]</code></p> <p>Additional components to be added to the editor or viewer.</p> <h3 id="extension-component"><code>ExtensionComponent&lt;T&gt;.component</code></h3> <p>Type: <code>typeof SvelteComponentTyped&lt;T &amp; { carta: Carta }&gt;</code></p> <p>Svelte components that exports <code>carta: Carta</code> and all the other properties specified as
	the generic parameter and in <code>props</code>.</p> <h3 id="extension-props"><code>ExtensionComponent&lt;T&gt;.props</code></h3> <p>Type: <code>T</code></p> <p>Properties that will be handed to the component.</p> <h3 id="extension-parent"><code>ExtensionComponent&lt;T&gt;.parent</code></h3> <p>Type: <code>MaybeArray&lt;'editor' | 'input' | 'renderer' | 'preview'&gt;</code></p> <p>Where the element will be placed.</p> <h3 id="grammar-rules"><code>grammarRules</code></h3> <p>Type: <code>GrammarRule[]</code></p> <p>Custom Markdown TextMate grammar rules for Shiki. They will be injected into the language.</p> <h3 id="highlight-rules"><code>highlightRules</code></h3> <p>Type: <code>HighlightingRule[]</code></p> <p>Custom highlighting rules for ShiKi. They will be injected into the selected theme.</p> <h3 id="on-load"><code>onLoad</code></h3> <p>Type: <code>(data: { carta: Carta; highlight: HighlightFunctions }) =&gt; void</code></p> <p>Use this callback to execute code when one Carta instance loads the extension.</p><!----><!---->","title":"Extension"},"/api/utilities":{"path":"/api/utilities","content":"API Utilities Carta.render Allows you to render Markdown asynchronously. const carta = new Carta({
  /* ... */
});
const markdown = '# Some Markdown';
const html = await carta.render(markdown);  Carta.renderSSR Allows you to render Markdown synchronously, suitable for Server Side Rendering. Note that
	particular extensions that add content asynchronously will not work in this configuration. const carta = new Carta({
