});
const markdown = '# Some Markdown';
const html = carta.renderSSR(markdown);  Carta.bindToCaret Svelte action that allows you to bind a specific element to the caret position. Used, for example,
	in plugin-emoji and plugin-slash. <script>
  export let carta;
</script>

<div use:carta.bindToCaret>
  <!-- ... -->
</div>  Carta.highlighter Get the Shiki highlighter. const highlighter = await carta.highlighter();
const userTheme = carta.theme;  Here are some other highlight related utilities: isBundleLanguage Checks if a language is a bundled language. export const isBundleLanguage = (lang: string): lang is BundledLanguage;  isBundleTheme Checks if a theme is a bundled theme. export const isBundleTheme = (theme: string): theme is BundledTheme;  isDualTheme Checks if a theme is a dual theme. export const isDualTheme = (theme: Theme | DualTheme): theme is DualTheme;  isSingleTheme Checks if a theme is a single theme. export const isSingleTheme = (theme: Theme | DualTheme): theme is Theme;  isThemeRegistration Checks if a theme is a theme registration. export const isThemeRegistration = (theme: Theme): theme is ThemeRegistration; ","html":"<!----><span class="section">API</span> <h1 class="title">Utilities</h1> <h2 id="carta-render"><code>Carta.render</code></h2> <p>Allows you to render Markdown asynchronously.</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> carta</span><span style="color:#EEF0F9"> = </span><span style="color:#54B9FF">new</span><span style="color:#00DAEF"> Carta</span><span style="color:#EEF0F9">({</span></span>
<span class="line"><span style="color:#EEF0F98F;font-style:italic">  /* ... */</span></span>
<span class="line"><span style="color:#EEF0F9">});</span></span>
<span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> markdown</span><span style="color:#EEF0F9"> = </span><span style="color:#FFD493">'# Some Markdown'</span><span style="color:#EEF0F9">;</span></span>
<span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> html</span><span style="color:#EEF0F9"> = </span><span style="color:#54B9FF">await</span><span style="color:#4BF3C8"> carta</span><span style="color:#EEF0F9">.</span><span style="color:#00DAEF">render</span><span style="color:#EEF0F9">(</span><span style="color:#4BF3C8">markdown</span><span style="color:#EEF0F9">);</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----> <h2 id="carta-render-ssr"><code>Carta.renderSSR</code></h2> <p>Allows you to render Markdown synchronously, suitable for Server Side Rendering. Note that
	particular extensions that add content asynchronously will not work in this configuration.</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> carta</span><span style="color:#EEF0F9"> = </span><span style="color:#54B9FF">new</span><span style="color:#00DAEF"> Carta</span><span style="color:#EEF0F9">({</span></span>
<span class="line"><span style="color:#EEF0F98F;font-style:italic">  /* ... */</span></span>
<span class="line"><span style="color:#EEF0F9">});</span></span>
<span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> markdown</span><span style="color:#EEF0F9"> = </span><span style="color:#FFD493">'# Some Markdown'</span><span style="color:#EEF0F9">;</span></span>
<span class="line"><span style="color:#54B9FF">const</span><span style="color:#ACAFFF"> html</span><span style="color:#EEF0F9"> = </span><span style="color:#4BF3C8">carta</span><span style="color:#EEF0F9">.</span><span style="color:#00DAEF">renderSSR</span><span style="color:#EEF0F9">(</span><span style="color:#4BF3C8">markdown</span><span style="color:#EEF0F9">);</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----> <h2 id="carta-bind-to-caret"><code>Carta.bindToCaret</code></h2> <p>Svelte action that allows you to bind a specific element to the caret position. Used, for example,
	in <code>plugin-emoji</code> and <code>plugin-slash</code>.</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#EEF0F9">&lt;</span><span style="color:#54B9FF">script</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#54B9FF">  export</span><span style="color:#54B9FF"> let</span><span style="color:#4BF3C8"> carta</span><span style="color:#EEF0F9">;</span></span>
<span class="line"><span style="color:#EEF0F9">&lt;/</span><span style="color:#54B9FF">script</span><span style="color:#EEF0F9">&gt;</span></span>
