olor:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">export</span><span style="color:#54B9FF"> const</span><span style="color:#00DAEF"> isBundleTheme</span><span style="color:#EEF0F9"> = (</span><span style="color:#4BF3C8;font-style:italic">theme</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">string</span><span style="color:#EEF0F9">): </span><span style="color:#4BF3C8;font-style:italic">theme</span><span style="color:#EEF0F9"> is </span><span style="color:#ACAFFF">BundledTheme</span><span style="color:#EEF0F9">;</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----> <h3 id="is-dual-theme"><code>isDualTheme</code></h3> <p>Checks if a theme is a dual theme.</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#54B9FF">export</span><span style="color:#54B9FF"> const</span><span style="color:#00DAEF"> isDualTheme</span><span style="color:#EEF0F9"> = (</span><span style="color:#4BF3C8;font-style:italic">theme</span><span style="color:#EEF0F9">: </span><span style="color:#ACAFFF">Theme</span><span style="color:#EEF0F9"> | </span><span style="color:#ACAFFF">DualTheme</span><span style="color:#EEF0F9">): </span><span style="color:#4BF3C8;font-style:italic">theme</span><span style="color:#EEF0F9"> is </span><span style="color:#ACAFFF">DualTheme</span><span style="color:#EEF0F9">;</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon