 style="color:#FFD493"> install</span><span style="color:#FFD493"> carta-plugin-video</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----><div class="mb-2 mt-6 flex items-end space-x-3"><h3 class="text-2xl font-medium text-neutral-200" id="carta-plugin-imsize"><code>carta-plugin-imsize</code></h3> <a href="https://github.com/maisonsmd/carta-plugin-imsize" aria-label="Github Link" class="flex aspect-square"><iconify-icon icon="mdi:github" class="text-3xl text-white hover:text-sky-300"></iconify-icon></a> <a href="https://www.npmjs.com/package/carta-plugin-imsize" aria-label="NPM Link" class="flex aspect-square"><iconify-icon icon="gg:npm" class="text-3xl text-white hover:text-sky-300"></iconify-icon></a></div><!----> Adds ability to render images in specific sizes. <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#00DAEF">npm</span><span style="color:#FFD493"> install</span><span style="color:#FFD493"> carta-plugin-imsize</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----><div class="mb-2 mt-6 flex items-end space-x-3"><h3 class="text-2xl font-medium text-neutral-200" id="carta-plugin-ins-del"><code>carta-plugin-ins-del</code></h3> <a href="https://github.com/maisonsmd/carta-plugin-ins-del" aria-label="Github Link" class="flex aspect-square"><iconify-icon icon="mdi:github" class="text-3xl text-white hover:text-sky-300"></iconify-icon></a> <a href="https://www.npmjs.com/package/carta-plugin-ins-del" aria-label="NPM Link" class="flex aspect-square"><iconify-icon icon="gg:npm" class="text-3xl text-white hover:text-sky-300"></iconify-icon></a></div><!----> `&lt;ins&gt;` and `&lt;del&gt;` tags support <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#00DAEF">npm</span><span style="color:#FFD493"> install</span><span style="color:#FFD493"> carta-plugin-ins-del</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----><div class="mb-2 mt-6 flex items-end space-x-3"><h3 class="text-2xl font-medium text-neutral-200" id="carta-plugin-subscript"><code>carta-plugin-subscript</code></h3> <a href="https://github.com/maisonsmd/carta-plugin-subscript" aria-label="Github Link" class="flex aspect-square"><iconify-icon icon="mdi:github" class="text-3xl text-white hover:text-sky-300"></iconify-icon></a> <a href="https://www.npmjs.com/package/carta-plugin-subscript" aria-label="NPM Link" class="flex aspect-square"><iconify-icon icon="gg:npm" class="text-3xl text-white hover:text-sky-300"></iconify-icon></a></div><!----> Adds ability to render subscripts and superscripts. <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#00DAEF">npm</span><span style="color:#FFD493"> install</span><span style="color:#FFD493"> carta-plugin-subscript</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----><!--]--><!----><!---->","title":"Community Plugins"},"/editing-styles":{"path":"/editing-styles","content":"Overview Editing Styles Customizing editor styles While the core styles are embedded in the Svelte components, the others can be set in a custom
	stylesheet. Here is what the final rendered HTML looks like. <div class="carta-editor carta-theme__<theme>">
  <div class="carta-toolbar">
    <div class="carta-toolbar-left">
      <!-- ... -->
    </div>
    <div class="carta-toolbar-right">
      <button class="carta-icon"><!-- ... --></button>
      <!-- Other icons -->
    </div>
  </div>

  <div class="carta-wrapper">
    <div class="carta-container mode-<split|tabs>">
      <div class="carta-input-wrapper">
        <pre class="carta-font-code"><!-- ... --></pre>
        <textarea class="carta-font-code" id="md" />
      </div>
      <div class="carta-renderer">
        <!-- Rendered Markdown -->
      </div>
    </div>
  </div>
</div>  Using multiple themes By using the theme property in <MarkdownEditor> you can differentiate
	the themes of multiple editors. Dark mode When using dark mode, there are two different themes that have to be changed: the editor theme and
	the one used for syntax highlighting: /* Editor dark mode */
/* Only if you are using the default theme */
html.dark .carta-theme__default {
  --border-color: var(--border-color-dark);
  --selection-color: var(--selection-color-dark);
  --focus-outline: var(--focus-outline-dark);
  --hover-color: var(--hover-color-dark);
  --caret-color: var(--caret-color-dark);
  --text-color: var(--text-color-dark);
}

/* Code dark mode */
/* Only if you didn't specify a custom code theme */
html.dark .shiki,
html.dark .shiki span {
  color: var(--shiki-dark) !important;
}
  Highlighting theme Carta uses Shiki for syntax highlighting.
	Two default themes are included in the core package, which are set as a dual theme to support light
	and dark mode. If you plan to use a custom one with light/dark modes, make sure to use a dual theme
	as well. You can change theme in the options: const carta = new Carta({
  // ...
  theme: 'github-dark'
});  If you use a custom theme(or
	a custom language), you need to provide it inside the options, so that it gets loaded into the
	highlighter: const carta = new Carta({
  // ...
  shikiOptions: {
    langs: // ...
    themes: // ...
  }
});  Markdown stylesheets Markdown is converted into standard HTML, so you can edit the final styles by using standard CSS
	rules. If you do not wish to create one from the ground up, you can use some already complete
	stylesheets, like github-markdown-css or Tailwind Typography.","html":"<!----><span class="section">Overview</span> <h1 class="title">Editing Styles</h1> <h2 id="editor-styles">Customizing editor styles</h2> <p>While the core styles are embedded in the Svelte components, the others can be set in a custom
	stylesheet. Here is what the final rendered HTML looks like.</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#EEF0F9">&lt;</span><span style="color:#54B9FF">div</span><span style="color:#ACAFFF"> class</span><span style="color:#EEF0F9">=</span><span style="color:#4BF3C8">"carta-editor carta-theme__</span><span style="color:#FFFFFF">&lt;</span><span style="color:#4BF3C8">theme&gt;"</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">  &lt;</span><span style="color:#54B9FF">div</span><span style="color:#ACAFFF"> class</span><span style="color:#EEF0F9">=</span><span style="color:#4BF3C8">"carta-toolbar"</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">    &lt;</span><span style="color:#54B9FF">div</span><span style="color:#ACAFFF"> class</span><span style="color:#EEF0F9">=</span><span style="color:#4BF3C8">"carta-toolbar-left"</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F98F;font-style:italic">      &lt;!-- ... --&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">    &lt;/</span><span style="color:#54B9FF">div</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">    &lt;</span><span style="color:#54B9FF">div</span><span style="color:#ACAFFF"> class</span><span style="color:#EEF0F9">=</span><span style="color:#4BF3C8">"carta-toolbar-right"</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">      &lt;</span><span style="color:#54B9FF">button</span><span style="color:#ACAFFF"> class</span><span style="color:#EEF0F9">=</span><span style="color:#4BF3C8">"carta-icon"</span><span style="color:#EEF0F9">&gt;</span><span style="color:#EEF0F98F;font-style:italic">&lt;!-- ... --&gt;</span><span style="color:#EEF0F9">&lt;/</span><span style="color:#54B9FF">button</span><span style="color:#EEF0F9">&gt;</span></span>
