<span class="line"><span style="color:#EEF0F9">      &lt;</span><span style="color:#54B9FF">div</span><span style="color:#ACAFFF"> class</span><span style="color:#EEF0F9">=</span><span style="color:#4BF3C8">"carta-input-wrapper"</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">        &lt;</span><span style="color:#54B9FF">pre</span><span style="color:#ACAFFF"> class</span><span style="color:#EEF0F9">=</span><span style="color:#4BF3C8">"carta-font-code"</span><span style="color:#EEF0F9">&gt;</span><span style="color:#EEF0F98F;font-style:italic">&lt;!-- ... --&gt;</span><span style="color:#EEF0F9">&lt;/</span><span style="color:#54B9FF">pre</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">        &lt;</span><span style="color:#54B9FF">textarea</span><span style="color:#ACAFFF"> class</span><span style="color:#EEF0F9">=</span><span style="color:#4BF3C8">"carta-font-code"</span><span style="color:#ACAFFF"> id</span><span style="color:#EEF0F9">=</span><span style="color:#4BF3C8">"md"</span><span style="color:#FFFFFF"> /</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">      &lt;/</span><span style="color:#54B9FF">div</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">      &lt;</span><span style="color:#54B9FF">div</span><span style="color:#ACAFFF"> class</span><span style="color:#EEF0F9">=</span><span style="color:#4BF3C8">"carta-renderer"</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F98F;font-style:italic">        &lt;!-- Rendered Markdown --&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">      &lt;/</span><span style="color:#54B9FF">div</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">    &lt;/</span><span style="color:#54B9FF">div</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">  &lt;/</span><span style="color:#54B9FF">div</span><span style="color:#EEF0F9">&gt;</span></span>
<span class="line"><span style="color:#EEF0F9">&lt;/</span><span style="color:#54B9FF">div</span><span style="color:#EEF0F9">&gt;</span></span></code></pre><!----> <button aria-label="Copy code" title="Copy" class="absolute right-4 top-[min(50%_,_32px)] aspect-square -translate-y-1/2 transform rounded hover:bg-neutral-800 hover:text-neutral-300 active:text-sky-300"><iconify-icon icon="octicon:copy-16" class="p-2 text-lg"></iconify-icon></button></div><!----> <h3 id="multiple-themes">Using multiple themes</h3> <p>By using the <code>theme</code> property in <code>&lt;MarkdownEditor&gt;</code> you can differentiate
