	the one used for syntax highlighting:</p> <div class="code-block relative"><!----><pre class="shiki houston" style="background-color:#17191e;color:#eef0f9" tabindex="0"><code><span class="line"><span style="color:#EEF0F98F;font-style:italic">/* Editor dark mode */</span></span>
